__NUXT_JSONP__("/blocks/microcontroller_port_maker", (function(a,b){return {data:[{slug:"microcontroller_port_maker",text:"\u003Cspan\u003E\u003Cclient-only\u003E\u003Ch1\u003EMicrocontroller Port Maker\u003C\u002Fh1\u003E\n\u003Cp\u003E\u003CModInfoCard :blockData=\"block\" :img=\"img\" :title=\"title\" \u002F\u003E\u003C\u002Fp\u003E\n\u003Ch2\u003EDescription\u003C\u002Fh2\u003E\n\u003Cp\u003EA microcontroller port maker can be used to generate port ranges for different microcontrollers.\u003C\u002Fp\u003E\n\u003Ch2\u003EUsage\u003C\u002Fh2\u003E\n\u003Cp\u003E\u003CWikiImage caption=\"Microcontroller Port Maker GUI\" src=\"\u002Fimg\u002Fmuc_port_maker_gui.png\" \u002F\u003E\u003C\u002Fp\u003E\n\u003Cp\u003EWhen placed, right click the microcontroller port maker to open the GUI. The GUI opens only if the player is in Creative mode, and has the proper permissions. An outline will be\ndrawn in the world; this is the bounding box of the area of the generated microcontroller ports.\u003C\u002Fp\u003E\n\u003Cp\u003EA piston cannot move this block.\u003C\u002Fp\u003E\n\u003Cp\u003EIn the GUI, there is a &quot;Prev&quot; and &quot;Next&quot; button to change the microcontroller type, as well as a rotation toggle to change the placement orientation. The MUC type is only used for\nchecking allowed port ranges. The &quot;Side length&quot; input indicates how often to create a new row; for example, a side length of 5 means every 5 ports a new row will be created. Depending\non the port range, there may be a row that's not entirely filled. The lower and upper port ranges are inclusive and indicate port ids; all ports from LOW to HIGH will be sequentially generated.\u003C\u002Fp\u003E\n\u003Cp\u003EWhen clicking &quot;Done&quot; settings will be saved; clicking &quot;Cancel&quot; will cancel any changes made.\u003C\u002Fp\u003E\n\u003Cp\u003ETo actually place the microcontroller port blocks, power the microcontroller port maker with redstone.\u003C\u002Fp\u003E\n\u003Ch2\u003EData Values\u003C\u002Fh2\u003E\n\u003Ch3\u003EID\u003C\u002Fh3\u003E\n\u003Ctable class=\"wiki_table\"\u003E\u003Cthead\u003E\n\u003Ctr\u003E\u003Cth\u003EName\u003C\u002Fth\u003E\u003Cth\u003E\u003Ca href=\"https:\u002F\u002Fminecraft.fandom.com\u002Fwiki\u002FNamespaced_ID\"\u003ENamespaced ID\u003C\u002Fa\u003E\u003C\u002Fth\u003E\u003Cth\u003EForm\u003C\u002Fth\u003E\u003Cth\u003ETranslation Key\u003C\u002Fth\u003E\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\u003Ctd\u003EMicrocontroller Port Maker\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Ccode\u003Ekontrol:muc_port_maker\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003Ctd\u003EBlock &amp; Item\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Ccode\u003Eblock.kontrol.muc_port_maker\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003Ctable class=\"wiki_table\"\u003E\u003Cthead\u003E\n\u003Ctr\u003E\u003Cth\u003EName\u003C\u002Fth\u003E\u003Cth\u003E\u003Ca href=\"https:\u002F\u002Fminecraft.fandom.com\u002Fwiki\u002FNamespaced_ID\"\u003ENamespaced ID\u003C\u002Fa\u003E\u003C\u002Fth\u003E\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\n\u003Ctr\u003E\u003Ctd\u003EBlock entity\u003C\u002Ftd\u003E\u003Ctd\u003E\u003Ccode\u003Ekontrol:muc_port_maker\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\n\u003C\u002Ftable\u003E\n\u003Ch3\u003EBlock data\u003C\u002Fh3\u003E\n\u003Cp\u003EMicrocontroller maker stores additional data in the form of a block entity:\u003C\u002Fp\u003E\n\u003Cp\u003E\u003CWikiTree icon=\"nbt\u002Fcompound.png\" :data=\"block_entity_data\" title=\"\u003Cb\u003EBlock entity data\u003C\u002Fb\u003E\" \u002F\u003E\u003C\u002Fp\u003E\n\u003C\u002Fclient-only\u003E\u003C\u002Fspan\u003E",img:"block\u002Fmuc_port_maker.png",block:{renewable:a,stackable:64,tools:[],blastResistance:3600000,hardness:-1,luminant:0,luminantToggle:a,transparent:a,flammable:a,catchesFireFromLava:a},title:"Microcontroller Port Maker",block_entity_data:[{icon:b,title:"rotationIndex:",text:"Index of the current rotation, from \u003Ccode\u003EBlockRotation.values()\u003C\u002Fcode\u003E"},{icon:b,title:"sideLength:",text:"Side length of one of the sides of the rectangle to generate. Will create a new row every this number of ports"},{icon:b,title:"portLower:",text:"Lower bound of port ids to generate, inclusive"},{icon:b,title:"portUpper:",text:"Upper bound of port ids to generate, inclusive"},{icon:b,title:"currentMUC:",text:"Index of the currently selected microcontroller"}]}],fetch:{},mutations:void 0}}(false,"nbt\u002Fint.png")));